import React from 'react';

class Gig extends React.Component {

    render() {
        const {name, image, desc} = this.props.details;
        return (           
            <div className="gig">
                <img src={image} alt={name} />
                <h3>{name}</h3>
                <p>{desc}</p>
            </div>
        )
    }
}

export default Gig;
